import { Segment, Form,Search } from "semantic-ui-react"


export default class GameFilter extends React.Component{
render(){
    return(
      <Segment inverted color="blue">
        <Form>
          <Form.Field onChange={this.props.sortByName}></Form.Field>
        <label>
          Search: 
        <input onChange={this.props.sortByName}></input>
        Search: 
        <input onChange={this.props.sortByCity}></input>
        </label>
        </Form>
      </Segment>

    )
}
}
